import React, { useEffect, useState } from 'react';
import { Grid, Typography, CircularProgress } from '@mui/material';
import DashboardCard from './DashboardComp';
import { OrdersChart } from './DashboardCard';
import { Bar } from 'react-chartjs-2';

const backendUrl = 'http://localhost:3001';

const DashboardPage = () => {
  const [summary, setSummary] = useState(null);
  const [ordersData, setOrdersData] = useState(null);
  const [dailyRevenue, setDailyRevenue] = useState(null);
  const [monthlyRevenue, setMonthlyRevenue] = useState(null);
  const [loading, setLoading] = useState(true);

  const today = new Date().toISOString().split('T')[0];
  const currentMonth = new Date().toISOString().slice(0, 7);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [summaryRes, ordersRes, dailyRes, monthlyRes] = await Promise.all([
          fetch(`${backendUrl}/dashboard/summary`).then(res => res.json()),
          fetch(`${backendUrl}/dashboard/orders-per-day`).then(res => res.json()),
          fetch(`${backendUrl}/dashboard/daily-revenue?date=${today}`).then(res => res.json()),
          fetch(`${backendUrl}/dashboard/monthly-revenue?month=${currentMonth}`).then(res => res.json()),
        ]);

        setSummary(summaryRes);
        setOrdersData(ordersRes);
        setDailyRevenue(dailyRes);
        setMonthlyRevenue(monthlyRes);
        setLoading(false);
      } catch (error) {
        console.error('Erro ao carregar dashboard:', error);
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const dailyRevenueChart = {
    labels: dailyRevenue?.orders?.map(o => o.clientName),
    datasets: [
      {
        label: 'Valor do Pedido',
        data: dailyRevenue?.orders?.map(o => o.total),
        backgroundColor: 'rgba(0, 123, 255, 0.6)',
      }
    ]
  };

  const monthlyRevenueChart = {
    labels: monthlyRevenue?.dailyData?.map(d => d.date),
    datasets: [
      {
        label: 'Faturamento Diário',
        data: monthlyRevenue?.dailyData?.map(d => d.revenue),
        backgroundColor: 'rgba(40, 167, 69, 0.6)',
      }
    ]
  };

  if (loading) return <CircularProgress />;

  return (
    <div>
      <Typography variant="h4" gutterBottom>Dashboard</Typography>

      <Grid container spacing={2}>
        <Grid item xs={12} md={3}>
          <DashboardCard title="Pedidos" value={summary.totalOrders} loading={loading} color="primary" />
        </Grid>
        <Grid item xs={12} md={3}>
          <DashboardCard title="Clientes" value={summary.totalClients} loading={loading} color="success" />
        </Grid>
        <Grid item xs={12} md={3}>
          <DashboardCard title="Produtos" value={summary.totalProducts} loading={loading} color="warning" />
        </Grid>
        <Grid item xs={12} md={3}>
          <DashboardCard title="Pendentes" value={summary.pendingOrders} loading={loading} color="error" />
        </Grid>
      </Grid>

      <Grid container spacing={2} mt={2}>
        <Grid item xs={12} md={6}>
          <OrdersChart data={{
            labels: ordersData?.map(o => o.date),
            datasets: [
              {
                label: 'Pedidos',
                data: ordersData?.map(o => o.count),
                backgroundColor: 'rgba(0, 123, 255, 0.6)',
              }
            ]
          }} loading={loading} />
        </Grid>

        <Grid item xs={12} md={6}>
          <OrdersChart data={dailyRevenueChart} loading={loading} />
        </Grid>

        <Grid item xs={12}>
          <div style={{ height: 300, marginTop: 20 }}>
            <Bar
              data={monthlyRevenueChart}
              options={{
                responsive: true,
                plugins: {
                  title: {
                    display: true,
                    text: 'Faturamento Mensal (por dia)'
                  },
                  legend: {
                    display: false
                  }
                },
                scales: {
                  y: {
                    beginAtZero: true
                  }
                }
              }}
            />
          </div>
        </Grid>
      </Grid>
    </div>
  );
};

export default DashboardPage;
